DROP TABLE IF EXISTS `c_gen_table`;
CREATE TABLE `c_gen_table` (
  `id` bigint NOT NULL,
  `name` varchar(255) DEFAULT NULL COMMENT '表名称',
  `comment_` varchar(255) DEFAULT NULL COMMENT '表注释',
  `swagger_comment` varchar(255) DEFAULT NULL COMMENT 'swagger注释',
  `ds_id` bigint DEFAULT NULL COMMENT '数据源',
  `author` varchar(255) DEFAULT NULL COMMENT '作者',
  `sub_id` bigint DEFAULT NULL COMMENT '关联子表的ID',
  `sub_java_field_name` varchar(255) DEFAULT NULL COMMENT '子表关联的外键Java字段名',
  `entity_name` varchar(255) DEFAULT NULL COMMENT '实体名称',
  `entity_super_class` varchar(255) DEFAULT NULL COMMENT '父类',
  `super_class` varchar(255) DEFAULT NULL COMMENT '实体父类',
  `parent` varchar(255) DEFAULT NULL COMMENT '父包名',
  `plus_module_name` varchar(255) DEFAULT NULL COMMENT '前端模块名;如：src/views/devOperation目录下的文件夹名 如：src/views/basic 目录下的文件夹名',
  `plus_application_name` varchar(255) DEFAULT NULL COMMENT '前端应用名;如：src/views目录下的basic和devOperation,basic表示基础平台。devOperation表示开发运营系统。xxx 表示你们自己新建的xxx系统。',
  `service_name` varchar(255) DEFAULT NULL COMMENT '服务名',
  `module_name` varchar(255) DEFAULT NULL COMMENT '模块名',
  `child_package_name` varchar(255) DEFAULT NULL COMMENT '子包名',
  `is_tenant_line` bit(1) DEFAULT b'0' COMMENT '行级租户注解',
  `ds_value` varchar(255) DEFAULT NULL COMMENT '数据源',
  `is_ds` bit(1) DEFAULT b'0' COMMENT '数据源级租户注解',
  `is_lombok` bit(1) DEFAULT b'1' COMMENT 'lombok',
  `is_chain` bit(1) DEFAULT b'1' COMMENT '链式模型',
  `is_column_constant` bit(1) DEFAULT b'0' COMMENT '是否生成字段常量',
  `gen_type` char(2) DEFAULT '01' COMMENT '生成代码方式;、; [01-zip压缩包 02-自定义路径] #GenTypeEnum{GEN:01,直接生成;ZIP:02,打包下载;}',
  `output_dir` varchar(255) DEFAULT '/' COMMENT '后端生成路径',
  `front_output_dir` varchar(255) DEFAULT NULL COMMENT '前端生成路径',
  `tpl_type` char(2) DEFAULT '01' COMMENT '使用的模板; #TplEnum{SIMPLE:01,单表;TREE:02,树结构;MAIN_SUB:03,主从结构}',
  `popup_type` char(2) DEFAULT '01' COMMENT '弹窗方式; #PopupTypeEnum{MODAL:01,对话框;DRAWER:02,抽屉;}',
  `add_auth` varchar(255) DEFAULT NULL COMMENT '新增按钮权限编码',
  `edit_auth` varchar(255) DEFAULT NULL COMMENT '编辑按钮权限编码',
  `delete_auth` varchar(255) DEFAULT NULL COMMENT '删除按钮权限编码',
  `view_auth` varchar(255) DEFAULT NULL COMMENT '查看按钮权限编码',
  `copy_auth` varchar(255) DEFAULT NULL COMMENT '复制按钮权限编码',
  `add_show` bit(1) DEFAULT b'1' COMMENT '新增按钮是否显示',
  `edit_show` bit(1) DEFAULT b'1' COMMENT '编辑按钮是否显示',
  `delete_show` bit(1) DEFAULT b'1' COMMENT '删除按钮是否显示',
  `copy_show` bit(1) DEFAULT b'1' COMMENT '复制按钮是否显示',
  `view_show` bit(1) DEFAULT b'1' COMMENT '详情按钮是否显示',
  `options` varchar(255) DEFAULT NULL COMMENT '其它生成选项',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `menu_parent_id` bigint DEFAULT NULL COMMENT '上级菜单ID',
  `menu_application_id` bigint DEFAULT NULL COMMENT '所属应用ID',
  `menu_name` varchar(255) DEFAULT NULL COMMENT '菜单名称',
  `menu_icon` varchar(255) DEFAULT '' COMMENT '菜单图标',
  `tree_parent_id` bigint DEFAULT NULL COMMENT '父ID字段名',
  `tree_name` varchar(255) DEFAULT NULL COMMENT '名称字段名',
  `created_by` bigint DEFAULT NULL COMMENT '更新者',
  `created_time` datetime DEFAULT NULL COMMENT '更新时间',
  `updated_by` bigint DEFAULT NULL COMMENT '创建者',
  `updated_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='代码生成字段';

